    been tasked to conduct a Population Viability Analysis (PVA) on the Morganza Floodway,
    Louisiana black bear (Ursus americanus luteolus) subpopulation. This analysis was
    performed for the U.S. Army Corps of Engineers (USACE) New Orleans District under
    Contract No. DACW-29-00-D-0002. This document provides a description of the project
    area, background information of the Morganza Floodway, purpose and need, study methodology,
